                    <Paper>3</Paper>
                </Grid>
                <Grid item xs={12} sm={6} md={3}>
                    <Paper>4</Paper>
                </Grid>

            </Grid> */}
      <Grid container>
        {data.map((note) => (
          <Grid key={note.id} xs={12} md={6} lg={4}>
            <Paper>{note.title}</Paper>
          </Grid>
        ))}
      </Grid>

      <p></p>
    </div>
  );
}

export default NoteData;
